  @Get()
  get(@Res() response: Response): Response {
    const hostname = os.hostname();
    const startTime = new Date(Date.now() - process.uptime()).toISOString();
    return response.status(HttpStatus.OK).send({
      available: true,
      //app: name,
      uptime: process.uptime(),
      serverId: `${hostname} ${process.pid}`,
      hostname,
      startTime,
      //version,
    });
  }

  @Get('nissan')
  getNissan(@Res() response: Response): Response {
    const data = JSON.parse(this.nissanTemplates);
    return response.status(HttpStatus.OK).send(data);
  }
